const t=JSON.parse('{"key":"v-2ae4875a","path":"/docs/Git%E7%AC%94%E8%AE%B0/git%E8%AE%BE%E7%BD%AE%E4%BB%A3%E7%90%86.html","title":"git设置代理","lang":"zh-CN","frontmatter":{"title":"git设置代理","icon":"edit","author":{"name":"ekskei","url":"https://github.com/ekskei"},"date":"2022-01-11T00:00:00.000Z","category":["git"],"tag":["git"],"description":"git设置代理 电脑上已经启用了代理，浏览器访问 github 很快，但是实际使用中发现 git clone 或者 push 到 github 很慢，经常出现超时。 在网上查了一下，发现 git 默认是不走代理的，需要自己手动设置。方法如下： 设置代理 这里使用的是 socks5 代理， PORT 是代理的端口号，需根据实际情况替换。我只针对 github 进行了设置，如果还有其他网站需要走代理，可以按照此方法进行设置。 git config --global http.https://github.com.proxy socks5://127.0.0.1:PORT","head":[["meta",{"property":"og:url","content":"https://codevk.com/docs/Git%E7%AC%94%E8%AE%B0/git%E8%AE%BE%E7%BD%AE%E4%BB%A3%E7%90%86.html"}],["meta",{"property":"og:site_name","content":"CODEVK"}],["meta",{"property":"og:title","content":"git设置代理"}],["meta",{"property":"og:description","content":"git设置代理 电脑上已经启用了代理，浏览器访问 github 很快，但是实际使用中发现 git clone 或者 push 到 github 很慢，经常出现超时。 在网上查了一下，发现 git 默认是不走代理的，需要自己手动设置。方法如下： 设置代理 这里使用的是 socks5 代理， PORT 是代理的端口号，需根据实际情况替换。我只针对 github 进行了设置，如果还有其他网站需要走代理，可以按照此方法进行设置。 git config --global http.https://github.com.proxy socks5://127.0.0.1:PORT"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-01-11T03:56:40.000Z"}],["meta",{"property":"article:author","content":"ekskei"}],["meta",{"property":"article:tag","content":"git"}],["meta",{"property":"article:published_time","content":"2022-01-11T00:00:00.000Z"}],["meta",{"property":"article:modified_time","content":"2023-01-11T03:56:40.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"git设置代理\\",\\"image\\":[\\"\\"],\\"datePublished\\":\\"2022-01-11T00:00:00.000Z\\",\\"dateModified\\":\\"2023-01-11T03:56:40.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"ekskei\\",\\"url\\":\\"https://github.com/ekskei\\"}]}"]]},"headers":[{"level":2,"title":"设置代理","slug":"设置代理","link":"#设置代理","children":[]},{"level":2,"title":"取消代理","slug":"取消代理","link":"#取消代理","children":[]}],"git":{"createdTime":1673409400000,"updatedTime":1673409400000,"contributors":[{"name":"ekskei","email":"837866535@qq.com","commits":1}]},"readingTime":{"minutes":0.61,"words":182},"filePathRelative":"docs/Git笔记/git设置代理.md","localizedDate":"2022年1月11日","excerpt":"<h1> git设置代理</h1>\\n<p>电脑上已经启用了代理，浏览器访问 github 很快，但是实际使用中发现 git clone 或者 push 到 github 很慢，经常出现超时。</p>\\n<p>在网上查了一下，发现 git 默认是不走代理的，需要自己手动设置。方法如下：</p>\\n<h2> 设置代理</h2>\\n<p>这里使用的是 socks5 代理， PORT 是代理的端口号，需根据实际情况替换。我只针对 github 进行了设置，如果还有其他网站需要走代理，可以按照此方法进行设置。</p>\\n<div class=\\"language-text line-numbers-mode\\" data-ext=\\"text\\"><pre class=\\"language-text\\"><code>git config --global http.https://github.com.proxy socks5://127.0.0.1:PORT\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div></div></div>","autoDesc":true}');export{t as data};
